import React from 'react';




export default function Footer() {
    return (
        
            <footer>
                
            <div className="footer-bg"></div>
                <div className="gh-logo"></div>
                <div className="twitter-logo"></div>
                <div className="insta-logo"></div>
                <div className="linkin-logo"></div>

            </footer>
        
    );
}
